D1 = 1.76; D2 = 3.29; chi1 = 0.0649; chi2 = 0.288;
r1 = 0.1; r2 = 0.9; h1 = 0; h2 = 0; beta1 = 8; beta2 = 10;
D3 = 8; mu = 0.035; beta = -250; delta0 = 0.5; k = pi;

alpha10 = 1; alpha1f = 10; dalf1 = 0.01; 
