        c0 = (h1.*(alpha1 - 1) + h2.*(alpha2 - 1))./(mu.*(alpha1.*alpha2 - 1) + beta1.*(alpha1 - 1) + beta2.*(alpha2 - 1));
        Fn = r1.*(1 - 2.*n0 - alpha1.*m0); Fm = -r1.*alpha1.*n0; Hn = h1 - beta1.*c0;
